import express from "express";
const router = express.Router();
import fs from "fs";
import path from "path";
router.get("/", (req, res) => {
    fs.readFile(path.join(__dirname, "list.json"), (err, data) => {
        if (err) {
            return res.status(500).json({
                message: "Lay meo that bai1"
            })
        }
        return res.status(200).json({
            message: "lay list thanh cong",
            data: JSON.parse(data)
        })
    })
})
router.delete('/listId', (req, res) => {
    if (req.params.listId) {
        fs.readFile(path.join(__dirname, "list.json"), 'utf-8', (err, data) => {
            if (err) {
                return res.status(500).json({
                    message: "Lấy lists thất bại!"
                })
            }
            let lists = JSON.parse(data);
            lists = lists.filter(list => list.id != req.params.listId);
            console.log("🚀 ~ file: list.module.js:28 ~ fs.readFile ~ lists :", lists )

        })
    } else {
        return res.status(500).json(
            {
                message: "Vui lòng truyền meoId!"
            }
        )
    }
})
module.exports = router;

